import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Catalogo from './Catalogo';
import Carrito from './Carrito';
import Navbar from './Navbar';
import "./estilos/HomeStyles.css"

const Home = () => {
  const navigate = useNavigate();
  const [mostrarCatalogo, setMostrarCatalogo] = useState(true);

  const handleVerCarrito = () => {
    navigate('/Carrito');
  };

  return (
    <main>
      <header>
        <nav>
          <ul>
            <li><button onClick={handleVerCarrito}>¡Comenzar a Comprar!</button></li>
          </ul>
        </nav>
        <h1>¡Compra tus mejores remeras en esta página!</h1>
      </header>
      
      <footer>
        <p>© 2024 Tienda de Remeras. Todos los derechos reservados.</p>
      </footer>
    </main>
  );
};

export default Home;
